Вижу людей на сквозь, пою, как соловей, играю на сцене, как богиня... Загадочная на всю голову, некоторые друзья зовут Стервой, другие Ведьмой, а самые добрые ласково - Феей))) А если серьёзно, то  зовут меня Елена Кондрашова (псевдоним Dgaretta Elena ) —  Экстрасенс, яснослышащая, ясновидящая, ясночувствующая, яснознающая, биоэнергетик, мистик, эзотерик, медиум, телепат, таролог, психолог, парапсихолог, нумеролог, эниолог, космоэнергет,  ворожея, ведунья, провидица, маг(колдунья), теософ; Эксперт-диагност по методу академика В.М.Бронникова; член общества Российского и Западный Ордена Восточных и Западных Тамплиеров О.Т. O. ; Член ассоциации Эзотериков России, Евросоюза, Египта, США , Китая , Тайланда. В 2013г.,2014г.,2015г.,2016г.,  выбрана, как одна из лучших Эзотериков России, участница международного реестра Эзотериков России «Лучшие Эзотерики России» 2013г., 2014г.,2015г.,2016г., участница международного реестра «Лучшие Специалисты народной медицины и эзотерики России» 2015г., ведущий эксперт — экстрасенс на телеканалах ТВ3 и ТНТ (за кулисами), 
певица, актриса, поэтесса, фотомодель  и не только .
 Со статьями, стихами и песнями Dgaretta Elena вы можете познакомится на сайте www.dgareta.ru и др. источниках, ссылки которых указаны ниже, либо в книгах.
